import info from '../data/info.json';


const ClubList = (props) => {
    const eachClub = props.clubs.map((item, i) => {
        return (
            <li key={i}>
                <Club especClub={item} />
            </li>
        )
    });



  return (
    <div className="App">
      <h2>{info[0].name}</h2>
      <ul>
       {eachClub}
      </ul>
    </div>
  );
}

export default ClubList;
